import React, { Component } from 'react';
import { Navbar, Nav, NavItem } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import './CustomNavbar.css'
import firebase, { auth, provider } from './firebase.js';

class App extends Component {
    constructor() {
        super();
        this.state = {
            currentItem: '',
            username: '',
            items: [],
            id: '',
            user: null,
        }
        this.handleChange = this.handleChange.bind(this);
        this.handleChange = this.handleSubmit.bind(this);
        this.login = this.login.bind(this);
        this.logout = this.logout.bind(this);
    }

    handleChange(e) {
        this.setState([
            [e.target.name]: e.target.value
        ]);
    }

    login() {
        auth.signInWithPopup(provider)
            .then((result) => {
                const user = result.user;
                const uId = user.uid;
                console.log(user.uid);
                this.setState({
                    user: null
                });
            });
    }

    handleSubmit(e) {
        e.preventDefault();
        const itemsRef = firebase.database().ref('items');
        const key = this.state.user.uid
        const item = {
            // title: this.state.currentItem,
            // user: this.state.user.uid,
            // carYear: this.state.carYear,
            // carMake: this.state.carMake,
            // carModel: this.state.carModel,
        }

        itemsRef.set(item);
        this.setState({
            "id": {
                currentItem: '',
                username: '',
                carYear: '',
                carMake: '',
                carModel: '',
            },
        });
    }
}
export default class CustomNavbar extends Component {
    render() {
        return (
            <Navbar default collapseOnSelect>
                <Navbar.Header>
                    <Navbar.Brand>
                        <Link to='/'>OBDII Live Data</Link>
                    </Navbar.Brand>
                </Navbar.Header>
                <Navbar.Collapse>
                    <Nav pullRight>

                        <NavItem eventKey={1} componentClass={Link} href="/" to="/">
                            Home
                        </NavItem>

                        <NavItem eventKey={2} componentClass={Link} href="/demo" to="/demo">
                            Demo
                        </NavItem>

                        <NavItem eventKey={3} componentClass={Link} href="/updates" to="/updates">
                            Updates
                        </NavItem>

                        <NavItem eventKey={3} componentClass={Link} href="/gauges/login" to="/gauges/login">
                            Login
                        </NavItem>



                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        )
    }
}
